import {Link} from "react-router-dom";
import Logo from "./IMG/logo.png";
import LKD from "./IMG/lkd.png";
import IG from "./IMG/ig.png"
import Style from "../Components/NavBar.module.css"



const NavBar = ()=>{
    return(
        <nav>
            <div class={Style.navbar}>
                <img class={Style.logo} src={Logo} alt="PoKeMon Pi"></img>
                    <ul class={Style.ul}>
                        <ul><Link class={Style.link} to="/home">Go To Home</Link></ul>
                        <ul><Link class={Style.link} to="/form">Create your Pokemon!</Link></ul>
                    </ul>
                
                <div>
                    <ul><img src={LKD} alt="Linkedin"></img></ul>
                    <ul><img src={IG} alt="instagram"></img></ul>
                </div>
            </div>

        </nav>
    )
}

export default NavBar;
